import styled from "styled-components";

const Container = styled.div`
display: flex;
flex-direction: column;
align-items: center;
margin: 30px 0 10px;
font-family: Oswald;
`;
const TransactionComponent = (props) => {
    return(
    <Container>TransactionComponent</Container>
    );
};
export default TransactionComponent;
